    if (!found) {
      result.push(obj1);
    } else {
      // Otherwise, check if message property exists in either object
      if (obj1.message || obj2.message) {
        // Add object with message property from first object if available
        result.push({
          stepId: obj1.stepId,
          fieldId: obj1.fieldId,
          message: obj1.message ? obj1.message : obj2.message
        });
      } else {
        // Add object with empty string as message property
        result.push({
          stepId: obj1.stepId,
          fieldId: obj1.fieldId,
          message: ""
